import { combineReducers } from "redux";

const typedHouseReducer = (
  typedHouse = 7,
  nameHouse = "MiddleHouse",
  action
) => {
  if (action.type !== "TYPE_OF_HOUSE") {
    return typedHouse;
  }

  switch (action.payload) {
    case "Small House":
      return { typedHouse: 5, nameHouse: action.payload };
    case "Middle House":
      return (typedHouse = 7);
    case "Big House":
      return (typedHouse = 9);
  }
};

export default combineReducers({
  typedHouse: typedHouseReducer
});
